import { BrowserRouter, Routes, Route } from 'react-router-dom'
import './App.css'

function App() {


    return (

            <BrowserRouter>
                <Routes>
                    <Route path='/home' element={ <h2>home page</h2> }/>
                    <Route path='/blog' element={<h2>blog page</h2>}/>
                </Routes>
            </BrowserRouter>
    )
}
export default App
